import GoogleMapReact from 'google-map-react';
import React from 'react';
import MarkerHover from '../component/MarkerHover';



const AnyReactComponent = ({ text }) => <div>{text}</div>;

function Map(props) {
    const defaultProps = {
        center: {
            lat: 59.95,
            lng: 30.33
        },
        zoom: 11
    };



    return (
        <div style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                //bootstrapURLKeys={{ key: /* YOUR KEY HERE */ }}
                defaultCenter={{lat: -8.186231,lng: 112.478758}}
                defaultZoom={14}
            >
                <MarkerHover lat={-8.186231} lng={112.478758} text={'kapal-1'} />
            </GoogleMapReact>
        </div>
    );
}

export default Map;
